import logo from './logo.svg';
import './App.scss';

const App=()=> {
  return (
    <div>
    <div></div>
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Hello pidor <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
    </div>
  );
}

const cucu=()=>{
  return(
    <div>
    <ul>
      <li>Хаю бич</li>
      <li>Хаю бичуган</li>
      <li>Хаю пельмень</li>
    </ul>
    </div>
  )
}

export default App;
